INSERT INTO `t_repository` VALUES ('11e7-5ae0-62b51c38-81f6-6b4698ae6d64', '6', 'function schoolid() \r\n{\r\n    var login=getWebUser().getLoginno();\r\n    var rtn=\"\";\r\n    if(login!=\"wizool\"){\r\n        var sql=\"SELECT ITEM_SCHOOLID FROM `tlk_账户管理` WHERE ITEM_ACCOUNT=\'\"+login+\"\'\";\r\n        var q=queryByDSName(\"xiaoxuan\",sql);\r\n        if(q!=null){\r\n            for(var a=q.iterator();a.hasNext();){\r\n                var b=a.next();\r\n                rtn=b.get(\"ITEM_SCHOOLID\");\r\n            }\r\n        }\r\n    }\r\n    return rtn;\r\n}', 'schoolid', '149853054333000000', '11e6-b051-0f2f0d26-b160-b54b43a1b70f');
