INSERT INTO `t_task` VALUES ('11e7-1298-5c2cd3d7-ae23-d5600e731c6a', '1', '0', 'Admin', '', '2017-06-23 09:39:36', '2017-06-23 09:39:36', '获取天气', 'var sql=\"SELECT ITEM_CNAME FROM `tlk_天气维护`\"\r\nvar zhi=\"\";\r\nvar q=queryByDSName(\"xiaoxuan\",sql);\r\nvar zhiid=\"\";\r\nif(q!=null){\r\n    for(var a=q.iterator();a.hasNext();){\r\n        var b=a.next();\r\n        zhi=b.get(\"ITEM_CNAME\");\r\n        var sql1=\"SELECT CITYID FROM `CITY` WHERE CITYNAME=\'\"+zhi+\"\'\";\r\n        println(sql1);\r\n        var q1=queryByDSName(\"xiaoxuan\",sql1);\r\n        for(var a1=q1.iterator();a1.hasNext();){\r\n            var b1=a1.next()\r\n            zhiid=b1.get(\"CITYID\");\r\n            println(\"--------------\"+zhiid);\r\n        }\r\n        var starttime=format(getToday(),\"yyyy-MM-dd\");\r\n        var tianqi=new Packages.wizool.tianqi.Test();\r\n        println(zhiid);\r\n        zhi1=tianqi.getWeather(zhiid,\"0\");\r\n        println(zhi1);\r\n        if(!zhi1.equals(\"没有此城市天气,或者程序没联网\")){\r\n            var doc = splitText(zhi1,\";\");\r\n            var url=\"\";\r\n            var path=\"/uploads/weather/\"+doc[0]+\".gif\"\r\n            url=\"[{\\\"name\\\":\\\"\"+doc[0]+\".gif\\\",\\\"path\\\":\\\"\"+path+\"\\\"}]\";\r\n            sql=\"UPDATE `tlk_天气维护` SET ITEM_WEATHER=\'\"+doc[0]+\"\',ITEM_DIRECTION=\'\"+doc[1]+\"\',ITEM_WIND=\'\"+doc[2]+\"\',ITEM_TEMPERATURE=\'\"+doc[4]+\"\',ITEM_MAXTEMPERATURE=\'\"+doc[3]+\"\',ITEM_ICON=\'\"+url+\"\',ITEM_STARTTIME=\'\"+starttime+\"\' WHERE ITEM_CNAME=\'\"+zhi+\"\'\";\r\n            updateByDSName(\"xiaoxuan\",sql);\r\n        }\r\n    }\r\n}', '', '1', '5611', '1', '1', '546', '11e6-b051-0f173f65-b160-b54b43a1b70f', '0', '0', '11e6-b051-0f2f0d26-b160-b54b43a1b70f', null, '\0', null);
